import React from "react";
import { Route, Switch } from "react-router-dom";

import Home from './components/Home';
import Recipe from "./components/Recipes";

const App = () => {

  return (
    <div>

      <div>
        <Switch>
          <Route path='/' component={Home}/>
          <Route path='/recipe/:id' component={Recipe}/>
        </Switch>
      </div>
    </div>
  );
};

export default App;
